In C, an if/then statement is written as:

```c
if (condition) {
    // code to be executed if condition is true
}
```

Here's a step-by-step guide to writing an if/then statement in C:

1. **Identify the condition**: Determine what you want to check. This is the expression that will be evaluated to determine whether the condition is true or false.
2. **Check the condition**: Evaluate the expression to determine whether it is true or false.
3. **If the condition is true, execute the code**: If the condition is true, execute the code inside the if block.
4. **If the condition is false, execute the code inside the else block**: If the condition is false, execute the code inside the else block.

Example:
```c
int x = 5;
if (x > 10) {
    printf("x is greater than 10\n");
} else {
    printf("x is less than or equal to 10\n");
}
```
In this example, the condition is `x > 10`, which is true
